import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import navvbar from './Components/Navbar';

function App() {
  return (
    <div className="App">
      <navvbar navvbar={navvbar}/>
    </div>
  );
}

export default App;
